import React, { useState, useEffect } from "react";

export default function AdminPreferences() {
  const [rankedPrefs, setRankedPrefs] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch("http://localhost:5000/api/users", {
      headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
    })
      .then((res) => res.json())
      .then((users) => {
        const counts = {};
        users.forEach((user) => {
          if (user.preferences && user.preferences.length) {
            user.preferences.forEach((pref) => {
              counts[pref] = (counts[pref] || 0) + 1;
            });
          }
        });

        const ranked = Object.entries(counts)
          .map(([pref, count]) => ({ preference: pref, count }))
          .sort((a, b) => b.count - a.count);

        setRankedPrefs(ranked);
        setLoading(false);
      })
      .catch((err) => {
        console.error("Error fetching users:", err);
        setLoading(false);
      });
  }, []);

  return (
    <div className="admin-pref-container">
      <style>{`
        .admin-pref-container {
          margin-left: 220px;
          padding: 20px;
          background-color: #f5f9f4;
          min-height: 100vh;
          font-family: "Poppins", sans-serif;
          color: #2f3e2f;
        }

        .admin-pref-title {
          color: #2b593f;
          font-size: 1.8rem;
          margin-bottom: 20px;
          text-shadow: 1px 1px 2px rgba(43, 89, 63, 0.2);
        }

        .admin-pref-status {
          font-size: 1rem;
          color: #6b8061;
          font-style: italic;
        }

        .admin-pref-table {
          width: 60%;
          border-collapse: collapse;
          background-color: #ffffff;
          box-shadow: 0 4px 10px rgba(56, 87, 66, 0.1);
          border-radius: 12px;
          overflow: hidden;
        }

        .admin-pref-table th {
          background-color: #89b48c;
          color: #fff;
          padding: 12px;
          text-align: left;
          font-weight: 600;
          letter-spacing: 0.5px;
        }

        .admin-pref-table td {
          border-bottom: 1px solid #d9e4d6;
          padding: 10px 12px;
        }

        .admin-pref-table tr:nth-child(even) {
          background-color: #f3f8f3;
        }

        .admin-pref-table tr:hover {
          background-color: #e7f2e7;
          transition: background-color 0.3s ease;
        }

        @media (max-width: 768px) {
          .admin-pref-table {
            width: 100%;
          }
          .admin-pref-container {
            margin-left: 0;
            padding: 15px;
          }
        }
      `}</style>

      <h2 className="admin-pref-title">ðŸŒ¿ Most Common Preferences</h2>
      {loading ? (
        <p className="admin-pref-status">Loading...</p>
      ) : rankedPrefs.length === 0 ? (
        <p className="admin-pref-status">No preferences found.</p>
      ) : (
        <table className="admin-pref-table">
          <thead>
            <tr>
              <th>Rank</th>
              <th>Preference</th>
              <th>Count</th>
            </tr>
          </thead>
          <tbody>
            {rankedPrefs.map((item, index) => (
              <tr key={item.preference}>
                <td>{index + 1}</td>
                <td>{item.preference}</td>
                <td>{item.count}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}
